import React, { Component } from 'react'
import { Button, Container, InputSearch } from './Todo'

export default class extends Component {
  constructor(props) {
    super(props)
    this.state = {
      data: []
    }
  }

render() {
  return (
    <Container>
      <InputSearch type={'text'} placeholder={'Search'} />
      <Button> + Add  </Button>
    </Container>
  )
}
}
